import styled from "styled-components";

const AuctionStyle = styled("div")`
  display: flex;
  flex-direction: column;
  align-items: center;
  form{
      width: 80vw;
      justify-content: center;
  }
  .theForm {
    width: 50%;
    margin-bottom: 30px;
    flex-basis: auto;
    @media(max-width: 700px) {
        width: 80%;
        margin-top: 20px;
    }
    .title,
    .description,
    .ImageLink,
    .genderList {
      margin-bottom: 20px;
    }
  }
  .genderList {
    list-style: none;
  }
`;

export default AuctionStyle;
